import React from "react";

class ToDoHeader extends Component<props> {
  render() {
    return (
      <div>
        <button onClick={onAddTodo}>Add Todo</button>
      </div>
    );
  }

  onAddToDo = () => {
    const newTodo = "test todo";
    this.props.onAdd(newTodo);
  };
}

export default ToDoHeader;
